import './style/header.css';
function Header() {
    return(
        <header>
            <div className='h-container'>
            <div className='h-background'>
            </div>
                <div className='header_row'>
                    <div className='header_logo'>Logo</div>
                    <div className='header_nav'>NAV</div>
                </div>
            </div>
        </header>
    )
}

export default Header;
